import React, { FC } from 'react'
import styles from './button.module.css'

type ClickType = {
  onClickHandler?: () => void
}

const ClickHandler = () => {
  if (onClickHandler) {
    onClickHandler()
  }
}

export const Button: FC<ClickType> = ({ onClickHandler }) => {
  return (
    <>
      <button type="submit" className={styles.buttonTweet} onClick={ClickHandler}>
        Tweet
      </button>
    </>
  )
}

export default Button
